import './App.css';
import Navbar from './Navbar';
import Home from './Home';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
      <Grid
                container
                spacing={2}
                direction="row"
                justify="flex-start"
                alignItems="flex-start"
            >
            <Grid item xs={12} sm={6} md={3} key={painting.id}>
        <Home />
        </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default App;
